var title_f10_12_10435="Algorithm breast mass over 30";
var content_f10_12_10435=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F74666&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F74666&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 623px\">",
"   <div class=\"ttl\">",
"    Diagnostic algorithm for palpable breast abnormalities in women aged 30 years and over",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 603px; height: 784px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    When lesions are palpable, clinically directed biopsies are often the most efficient. Fine-needle aspiration (FNA) is the biopsy of choice, but if it is not available or reliable at an institution, percutaneous core biopsy can easily be substituted.",
"    <div class=\"footnotes\">",
"     BI-RADS: Breast Imaging Reporting and Data System; U/S: ultrasound; FNA: fine-needle aspiration.",
"     <br>",
"      * The asterisk indicates a situation in which it may be useful to incorporate a staging MRI into the management of a patient with breast cancer if this technique is available.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from Esserman, L, et al. Current Oncology Reports 2000; 2:572.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
