var title_f10_12_10438="Primary ciliary dyskinesia";
var content_f10_12_10438=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F75562%7EPULM%2F77377&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F75562%7EPULM%2F77377&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Primary ciliary dyskinesia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 357px; height: 352px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Cross-sectioned axoneme from a man with immotile-cilia syndrome. The dynein arms are lacking from the axoneme, resulting in immotile cilia and sperm tails.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     From Afzelius, BA, et al. Tissue &amp; Cell 1995; 27:241.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Normal ciliary structure",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 301px; height: 300px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Cross-sectioned axoneme from a man with normal, motile cilia and spermatozoa. Nine microtubular doublets form a circle, 0.2 micrometer wide, surrounding two central microtubules. Along each of the nine doublets there is a row of outer dynein arms and a row of inner dynein arms. These dynein arms are the force-producing elements in cilia and sperm flagella.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     From: Afzelius, BA, Dallai, R, Lanzavecchia, S, Bellon, PL. Flagellar structure in normal human spermatozoa and in spermatozoa that lack dynein arms. Tissue Cell 1995 27:241.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
