"     <a class=\"medical medical_review\" href=\"UTD.htm?5/33/5656?source=related_link\">",
"      ALA dehydratase porphyria",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?39/16/40198?source=related_link\">",
"      Etiology and pathogenesis of acute intermittent porphyria",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?3/20/3398?source=related_link\">",
"      Management of acute intermittent porphyria",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?7/46/7913?source=related_link\">",
"      Pathophysiology and etiology of the syndrome of inappropriate antidiuretic hormone secretion (SIADH)",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
