" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Clinical manifestations of opioid toxicity",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        System",
"       </td>",
"       <td class=\"subtitle1\">",
"        Manifestations",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pulmonary",
"       </td>",
"       <td>",
"        Respiratory depression, bronchospasm, noncardiogenic pulmonary edema",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cardiovascular",
"       </td>",
"       <td>",
"        Orthostatic hypotension, peripheral vasodilation, dysrhythmias",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Neurologic",
"       </td>",
"       <td>",
"        Analgesia, euphoria, dysphoria, miosis, mydriasis, seizures",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Gastrointestinal",
"       </td>",
"       <td>",
"        Nausea, vomiting, constipation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Dermatologic",
"       </td>",
"       <td>",
"        Flushing, pruritus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Reproductive",
"       </td>",
"       <td>",
"        Amenorrhea, anovulation",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
